import React, { useState } from 'react';

function FlightSearchForm() {
  const [formData, setFormData] = useState({
    from: '',
    to: '',
    departure: '',
    return: '',
    passengers: 1,
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Searching for flights:', formData);
  };

  return (
    <form onSubmit={handleSubmit} style={{ padding: '20px', backgroundColor: '#f9f9f9', borderRadius: '10px' }}>
      <label>
        From:
        <input type="text" name="from" value={formData.from} onChange={handleChange} />
      </label>
      <label>
        To:
        <input type="text" name="to" value={formData.to} onChange={handleChange} />
      </label>
      <label>
        Departure:
        <input type="date" name="departure" value={formData.departure} onChange={handleChange} />
      </label>
      <label>
        Return:
        <input type="date" name="return" value={formData.return} onChange={handleChange} />
      </label>
      <label>
        Passengers:
        <input type="number" name="passengers" value={formData.passengers} onChange={handleChange} min="1" />
      </label>
      <button type="submit">Search Flights</button>
    </form>
  );
}

export default FlightSearchForm;
